BEGIN TRANSACTION;
DROP TABLE IF EXISTS "packs_pbf_type";
CREATE TABLE IF NOT EXISTS "packs_pbf_type" (
	"product"	TEXT,
	"pbf_name"	TEXT,
	"type"	TEXT
);
DROP TABLE IF EXISTS "songs";
CREATE TABLE IF NOT EXISTS "songs" (
	"pbf_name"	TEXT,
	"song_name"	TEXT,
	"product_name"	TEXT,
	"type"	TEXT,
	UNIQUE("pbf_name","song_name","product_name","type")
);
COMMIT;